import React, { Component }  from 'react';
import "./Navbar.css";
import {Person, Close, Phone, Email, GitHub} from '@material-ui/icons';

export default function Navbar({navContactOpen, setNavContactOpen}) {
    return (
        <div className="navbar">
            <div className="nav-container">
                <div className="nav-left">
                    <a href="#intro" className="nav-brand">JTB</a>
                </div>
                <div className="nav-right" onClick={() => setNavContactOpen(!navContactOpen)}>
                    <div className={"contact-info " + (navContactOpen && "active")}>
                        <Phone></Phone> <span className="contact-text" >+1 (510) 427-2571</span>
                        <Email></Email><span className="contact-text" >buenajosepht@gmail.com</span> 
                        <GitHub></GitHub> <span className="contact-text" >github.com/buenajoseph</span>
                    </div>
                    <Person className={"icon " + (!navContactOpen && "active")}></Person>
                    <Close className={"icon " + (navContactOpen && "active")}></Close>
                </div>
            </div>
        </div>
    )

}
